theme_options.auxin_user_custom_css:
.aux-gallery-container.aux-col4 .aux-plus-bg {
    display: none;
}

.aux-user-entry .hentry .aux-widget-text .entry-content {
    margin-bottom:0; 
}

/* hide empty titles in mega menu */
#menu-item-100 div.aux-item-content{ display: none; }

/* style buttons on elements/button page */
.button-wrapper{
    float: left;
    margin-right: 16px;
}
.button-divider{
    overflow: auto;
}

